import logo from './logo.svg';
import './App.css';
import React, {useEffect,useState} from 'react'
import { BrowserRouter, Routes, Route, useNavigate } from "react-router-dom";



function GamePage({thumbnail,info}) {
  return (
    <div>
      <h1>{info["name"]}</h1>
      {/* <img src={thumbnail}/> */}
    </div>
  );
}

function Home({links,names}) {
  // const [infos,setInfo] = useState([]);
  // const [thumbnails,setThumbnail] = useState([]);
  const [gameList,setGameList] = useState([]);
  const navigate = useNavigate();
  useEffect(()=> {
    // fetch("/api").then(response=>response.json()).then(data => {
    //   setInfo(data["infos"]);
    //   setThumbnail(data["thumbnails"]);
    //   let nameList = data["names"];
    //   let routeList = [];
    //   for (let i = 0; i < links.length; i++) {
    //     routeList.push(<a onClick={()=>navigate("/"+links[i])}>{nameList[i]}</a>);
    //   }
    //   setGameList(routeList);
    // });
    let routeList = [];
    for (let i = 0; i < links.length; i++) {
      routeList.push(<button onClick={()=>navigate("/"+links[i])}>{names[i]}</button>);
    }
    setGameList(routeList);
  },[]);
  return (
    <div>
      <h1>Game List</h1>
      {gameList}
    </div>
  );
}




function App() {

  const [gameRoutes, setGameRoutes] = useState([]);
  const [homeRoute, setHomeRoute] = useState([]);

  useEffect(()=> {
    fetch("/api").then(response=>response.json()).then(data => {
      let descList = data["descs"];
      let routeList = [];
      let linkPaths = [];
      for (let i = 0; i < descList.length; i++) {
        let str = "/"+descList[i]["name"].replace(" ","_")
        routeList.push(<Route path={str} element={<GamePage  num={i}info={descList[i]["names"]} thumbnail={data["thumbnails"][i]}/>} />);
        linkPaths.push(str);
      }
      console.log(data,linkPaths);
      setGameRoutes(routeList);
      setHomeRoute(<Route path="/" element={<Home links={linkPaths} names={descList}/>} />);
    });
  },[]);

  return (
    <BrowserRouter>
      <Routes>
        {/* {homeRoute}
        {gameRoutes} */}
      </Routes>
    </BrowserRouter>

  );
}

export default App;
